import React from 'react';

const InputField = ({ label, value, onChange, type = 'text' }) => {
  const labelStyle = { margin: '10px 0', fontWeight: 'bold', color: '#fff' };
  const inputStyle = {
    width: '100%',
    padding: '8px',
    marginBottom: '10px',
    borderRadius: '4px',
    border: '1px solid #ccc',
  };

  return (
    <div>
      <label style={labelStyle}>{label}</label>
      <input
        type={type}
        value={value}
        onChange={onChange}
        style={inputStyle}
      />
    </div>
  );
};

export default InputField;
